// file entities.ts

import { injectable, inject } from "inversify";
import "reflect-metadata";
import { Weapon, ThrowableWeapon, Warrior } from "./interfaces";
import { TYPES } from "./types";
import { KpiRepository } from "../repository/KpiRepository";
import KpiData from "../components/kpi-cards/KpiData";
import axios from "axios";

@injectable()
class Katana implements Weapon {
    public hit() {
        return "cut!";
    }
}

@injectable()
class Shuriken implements ThrowableWeapon {
    public throw() {
        return "hit!";
    }
}

@injectable()
class Ninja implements Warrior {
    @inject(TYPES.Weapon) private _katana: Weapon | any;
    @inject(TYPES.ThrowableWeapon) private _shuriken: ThrowableWeapon | any;
    public fight() { return this._katana.hit(); }
    public sneak() { return this._shuriken.throw(); }

}

@injectable()
class KpiRepositoryImpl implements KpiRepository {
    private readonly apiUrl: string;

    constructor(@inject(TYPES.ApiBaseUrl) apiUrl: string) {
        this.apiUrl = apiUrl;
    }

    async fetchKpis(): Promise<KpiData> {
        console.log('about to fetch???');
        try {
            const response = await axios.get(this.apiUrl);
            return response.data;
        } catch (error) {
            throw new Error("Error fetching KPIs");
        }
    }
}

export { Ninja, Katana, Shuriken, KpiRepositoryImpl };
